import React, { useState } from 'react';
import { Link } from 'react-router-dom';

const DashboardPage = () => {
  const [selectedShoe, setSelectedShoe] = useState(null);

  // Function to add the selected shoe to the dashboard
  const handleAddShoe = () => {
    // Check if a shoe is selected
    if (selectedShoe) {
      // Implement the logic to add the selected shoe to the dashboard data
      // For now, we'll just print the name of the shoe to the console
      console.log('Added shoe:', selectedShoe);
    }
  };

  return (
    <div>
      <header>
        <div className="title-container">
          <h1>SHOE COLLECTION</h1>
        </div>
        <nav className="nav-links-container">
          <Link to="/addshoe" className="add-shoe-button">
            Add Shoe
          </Link>
          <Link to="/" id="logout-button">
            Log Out
          </Link>
        </nav>
      </header>
      <main className="login-main">
        {/* Render the selected shoe information */}
        {selectedShoe && (
          <div>
            <h2>Selected Shoe:</h2>
            <p>{selectedShoe}</p>
          </div>
        )}
      </main>
      <footer>
        <p>Copyright Â© 2023 Shoe Collection</p>
      </footer>
    </div>
  );
};

export default DashboardPage;
